import './App.css';
import NavBar from './Components/NavBar';
import About from './Components/Pages/About';
import Explore from './Components/Pages/Explore';
import Home from './Components/Pages/Home';

function App() {
  return (
    <div className="App">
      <NavBar />
      <section id='home'>
        <Home />
      </section>
      <section id='about'>
        <About />
      </section>
      <section id='explore'>
       <Explore />
      </section>

    </div>
  );
}

export default App;
